import { BrowserRouter as Router, Route } from 'react-router-dom'; // Импортируем BrowserRouter и Route
   import Login from './Login'; // Импортируем компоненты Login и Home
   import Home from './Home';
   import App from './App'; // Импортируем компонент App

   ReactDOM.render(
      <Router>
         <Route exact path="/" component={App} />
         <Route path="/login" component={Login} />
         <Route path="/home" component={Home} />
      </Router>,
      document.getElementById('root')
   );

export default App;
